import React from 'react';
import { View } from 'react-native';
import MenuHeader from './components/menuHeader'
import MenuNavigationBar from './components/menuNavigationBar'

export default class Menu extends Component {
  render() {
    <View>
      <MenuHeader />
      <MenuNavigationBar />
    </View>
  }
}
